import Accordion from 'react-bootstrap/Accordion';
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

import BrainBoosters from './Supplements/BrainBoosters.js';
import HeartHealth from './Supplements/HeartHealth.js';
import JointHealth from './Supplements/JointHealth.js';
import LiverTonic from './Supplements/LiverTonic.js';
import NaturalAntiOxidants from './Supplements/NaturalAntiOxidants.js';
import HormonesOralContraceptives from './Supplements/HormonesOralContraceptives.js';
import SlimmingWeightMgmt from './Supplements/SlimmingWeightMgmt.js';


function Product () {

    const [pageStatus, setPageStatus] = useState("");

    const clickHandler = (message) => {
        setPageStatus(message);
    }

    /*For menu navigation*/
    // const [isBB, setBB] = useState(true);
    // const [isHH, setHH] = useState(false);
    // const [isJH, setJH] = useState(false);
    // const [isLT, setLT] = useState(false);
    // const [isNAO, setNAO] = useState(false);
    // const [isHOC, setHOC] = useState(false);
    // const [isSWM, setSWM] = useState(false);


    // const clickHandler = (message) => {
    //     if (message === 'BB') {
    //         setBB(true);
    //         setHH(false);
    //         setJH(false);
    //         setLT(false);
    //         setNAO(false);
    //         setHOC(false);
    //         setSWM(false);
    //     } else if (message === 'HH') {
    //         setBB(false);
    //         setHH(true);
    //         setJH(false);
    //         setLT(false);
    //         setNAO(false);
    //         setHOC(false);
    //         setSWM(false);
    //     } else if (message === 'JH') {
    //         setBB(false);
    //         setHH(false);
    //         setJH(true);
    //         setLT(false);
    //         setNAO(false);
    //         setHOC(false);
    //         setSWM(false);
    //     } else if (message === 'LT') {
    //         setBB(false);
    //         setHH(false);
    //         setJH(false);
    //         setLT(true);
    //         setNAO(false);
    //         setHOC(false);
    //         setSWM(false);
    //     } else if (message === 'NAO') {
    //         setBB(false);
    //         setHH(false);
    //         setJH(false);
    //         setLT(false);
    //         setNAO(true);
    //         setHOC(false);
    //         setSWM(false);
    //     } else if (message === 'HOC') {
    //         setBB(false);
    //         setHH(false);
    //         setJH(false);
    //         setLT(false);
    //         setNAO(false);
    //         setHOC(true);
    //         setSWM(false);
    //     } else if (message === 'SWM') {
    //         setBB(false);
    //         setHH(false);
    //         setJH(false);
    //         setLT(false);
    //         setNAO(false);
    //         setHOC(false);
    //         setSWM(true);
    //     } else {
    //         setBB(true);
    //         setHH(false);
    //         setJH(false);
    //         setLT(false);
    //         setNAO(false);
    //         setHOC(false);
    //         setSWM(false);
    //     }
    // }

    // useEffect(() => {
    //     setCount(JSON.parse(window.localStorage.getItem('count')));
    //   }, []);
    
    // useEffect(() => {
    // window.localStorage.setItem('count', count);
    // }, [count]);


    return (
        <>
            <div className="container section product">
                <div className="row">
                    <div className="col-12 col-sm-4">

                        <Accordion defaultActiveKey="0" flush>
                            <Accordion.Item eventKey="0">
                                <Accordion.Header>Supplements</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link to="/products/brain-boosters-memory-enhancers" onClick={() => clickHandler("BB")} className={`${isBB ? 'itemActive' : ''}`}>Brain boosters/memory enhancers </Link></li>
                                        <li><Link to="/products/heart-health" onClick={() => clickHandler("HH")} className={`${isHH ? 'itemActive' : ''}`}>Heart health </Link></li>
                                        <li><Link to="/products/joint-health" onClick={() => clickHandler("JH")} className={`${isJH ? 'itemActive' : ''}`}>Joint health </Link></li>
                                        <li><Link to="/products/liver-tonic" onClick={() => clickHandler("LT")} className={`${isLT ? 'itemActive' : ''}`}>Liver tonic </Link></li>
                                        <li><Link to="/products/natural-antioxidants" onClick={() => clickHandler("NAO")} className={`${isNAO ? 'itemActive' : ''}`}>Natural anti-oxidants </Link></li>
                                        <li><Link to="/products/hormones-oral-contraceptives" onClick={() => clickHandler("HOC")} className={`${isHOC ? 'itemActive' : ''}`}>Hormones/Oral contraceptives </Link></li>
                                        <li><Link to="/products/slimming-weight-management" onClick={() => clickHandler("SWM")} className={`${isSWM ? 'itemActive' : ''}`}>Slimming/weight management </Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="1">
                                <Accordion.Header>Injury</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Blunt trauma / Bruising </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Muscle relaxants </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Wound healing </Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="2">
                                <Accordion.Header>Illness</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Cough & Cold preparations </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Ear, nose & throat preparations </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Urinary incontinence </Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="3" className="singleItem">
                                <Accordion.Header>
                                    <Link href="#/" target="_blank" rel="noreferrer noopener">Dermatological </Link>
                                </Accordion.Header>
                            </Accordion.Item>
